

# Definition for singly-linked list.
class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next


class Solution:
    def sortList(self, head: [ListNode]) -> [ListNode]:
        return self.quickSort(head, None)

    def quickSort(self, head, end):
        # quick sort
        def partition(head, end):
            if head == end or not head.next:
                return head, None

            # lets use the first element as pivot
            x = head.val
            prev = head
            pivot = head
            while prev != end:
                cur = prev.next
                
                if cur == end:
                    right = pivot.next
                    pivot.next = None
                    return head, right

                if cur.val < x:
                    prev.next = cur.next
                    cur.next = head
                    head = cur
                else:
                    prev = cur
            
            right = pivot.next
            pivot.next = None
            return head, right



        if head == end or not head.next:
            return head

        pivot = head
        head, right = partition(head, end)
        h1 = self.quickSort(head, None)
        h2 = self.quickSort(right, None)
        pivot.next = h2 

        return h1

        
        

    def printList(self, head):
        while head:
            print(head.val, end = ' ')
            head = head.next
        print("\n")


    def mergeSort(self, head):
        # Top down
        def merge(l1, l2):
            head = curr = ListNode()
            while l1 and l2:
                if l1.val < l2.val:
                    curr.next = l1
                    l1 = l1.next
                else:
                    curr.next = l2
                    l2 = l2.next
                curr = curr.next

            curr.next = l1 or l2
            return head.next

        def getMid(head):
            midPrev = ListNode()
            slow = fast = head

            while fast and fast.next:
                midPrev = slow
                slow = slow.next
                fast = fast.next.next

            midPrev.next = slow
            return slow

        if not head or not head.next:
            return head

        mid = getMid(head)
        left = mergeSort(head)
        right = mergeSort(mid)
        return merge(left, right)

    def mergeSort2(self, head):
        # bottom up

        def merge(l1, l2, tail):
            dummy = curr = ListNode()
            while l1 and l2:
                if l1.val < l2.val:
                    curr.next = l1
                    l1 = l1.next
                else:
                    curr.next = l2
                    l2 = l2.next
                curr = curr.next

            curr.next = l1 or l2
            while curr.next:
                curr = curr.next
            
            # link the last tail
            tail.next = dummy.next

            # return the new tail
            return curr

        # divide the linked list into two lists
        # first linked list contains n nodes
        # return the head of second linked list
        def split(head, n):
            for ii in range(n - 1):
                if head:
                    head = head.next
                else:
                    break
            
            if not head:
                # not enough nodes
                return None

            # start of second list
            second = head.next

            # cut off current list
            head.next = None

            return second

        def getLength(head):
            length = 0
            while head:
                head = head.next
                length += 1
            return length

        if not head or not head.next:
            # if only one item in the list or nothing
            return head

        dummy = ListNode(next=head);
        length = getLength(head)
        step = 1
        while step < length:
            # curr: start node of a list
            # tail: tail of last list
            cur, tail = dummy.next, dummy
            while cur:
                left = cur
                right = split(left, step)
                cur = split(right, step)
                tail = merge(left, right, tail)
            step *= 2
        return dummy.next


